    false,nt"url": null,nt"notes": "This Record of Decision (ROD) documents
    the decision and rationale for selecting a water rights acquisition strategy to
    sustain a long-term average of 25,000 acres of primary wetland habitat in the Lahontan
    Valley, as directed by the Truckee-Carson-Pyramid Lake Water Rights Settlement Act,
    Title II of Public Law 101-618 (Public law 101-618). The ROD was developed by the
    U.S. Fish and Wildlife Service in compliance with agency decision-making requirements
    for the National Environmental Policy Act (NEPA) of 1969, as amended. The Final
    Environmental Impact Statement provides an in-depth analysis of alternatives for
    acquiring sufficient water to achieve the 25,000-acre objective.",nt"license_title":
